import "../index.css";
import "./Card";
const Info = (props) => {
  console.log("Hello there");
  return (
    <ul id="concepts">
      <Card>
        {props.concepts.map((item) => (
          <li className="concept">
            <div>
              <div className="mid">
                <img src={item.image} alt="Todo" />
              </div>
              <br />
              <div>
                <h2>{item.title}</h2>
                <br />
                <p>{item.description}</p>
              </div>
            </div>
          </li>
        ))}
      </Card>
    </ul>
  );
};
export default Info;
